import React from "react"

const Report=(props)=>{
    const {data}=props

    const host=()=>{
        let result
        data.map((ele)=>{
            if(ele.guest==="No"){
                result=ele.name
            }
        })
        return result
    }

    return <div>
                <h1>Report</h1>
                <h3>Host-{host()}</h3>
                <h3>Total participants-{data.length+1}</h3>
                <h3>Duration-</h3>
               
        </div>
}

export default Report
